import React, {useState} from 'react'

const App = () => {
    const [counter, setCounter] = useState(0);

    const handleClick = () => {
        console.log('Clicked')
    }

    setTimeout(
        () => setCounter(counter + 1),
        1000
    )
    console.log('rendering...', counter);
    return (
        <>
            <div>{counter}</div>
            <button onClick = {handleClick}>
                Plus
            </button>
        </>


    )
}

export default App
